        /// <summary>
        /// File name without ext.
        /// </summary>
        internal string ProjectName { get; private set; }

        /// <summary>
        /// Full path and file name.
        /// </summary>
        internal string FullProjectName { get; private set; }

        List<MemmoryValueBak> memmoryValues;
        List<SchemeBak> schemeBaks;
