        internal LoadSave()
        {
            schemeBaks = new List<SchemeBak>();
            bugIdRemap = new Dictionary<int, int>();
            memmoryValues = new List<MemmoryValueBak>();
        }

        /// <summary>
        /// Saves whole project into file.
        /// </summary>
        /// <param name="workplace"></param>
        internal void Save(WorkPlace workplace)
        {
            workplace.Simulation.StopThread();

            //Create directory.
            string path = Path.GetDirectoryName(workplace.Project.FullProjectName);
            if (Directory.Exists(path) == false)
                Directory.CreateDirectory(path);

            using (XmlWriter xml = XmlWriter.Create(workplace.Project.FullProjectName))
            {
                xml.WriteStartDocument();
                xml.WriteStartElement(XML.Element1);

                //Write ProjectInfo
                xml.WriteStartElement(XML.Element2);
                xml.WriteAttributeString(XML.Param1, workplace.Project.ProjectName);
                xml.WriteAttributeString(XML.Param2, workplace.Project.TopPScheme.PlacedBug.Bug.ID.ToString());
                xml.WriteEndElement();

                //Write codes.
                xml.WriteStartElement(XML.Element4);
                workplace.Project.Programmability.Save(xml);
                xml.WriteEndElement();

                //Write memory values
                xml.WriteStartElement(XML.Element5);
                workplace.Project.SchemeStructure.SaveMemmoryValues(xml);
                xml.WriteEndElement();

                //Write schemes.
                List<Bug> bugs = workplace.Project.SchemeStructure.GetBugsOrderedByDependancy();
                foreach (Bug bug in bugs)
                {
                    if (bug.Scheme != null)
                    {
                        SchemeBak bak = new SchemeBak();
                        bak.CreateFromScheme(bug.Scheme);

                        xml.WriteStartElement(XML.Element3);
                        bak.Save(xml);
                        xml.WriteEndElement();
                    }
                }

                xml.WriteEndElement();
                xml.WriteEndDocument();
            }
            workplace.Simulation.StartThread();
        }

        /// <summary>
        /// Before calling this function clear application from old project data.
        /// Loads whole project from file and prepares aplication to be used.
        /// </summary>
        /// <param name="workplace"></param>
        /// <param name="fullProjectName"></param>
        internal void Load(WorkPlace workplace, string fullProjectName, string innerFile)
        {
            //Store full file path, so I will know where to save project.
            this.FullProjectName = fullProjectName;

            this.schemeBaks = new List<SchemeBak>();
            int topBugID = -1;
            XmlReader xml;
            if (fullProjectName != null)
                xml = XmlReader.Create(fullProjectName);
            else
            {
                //string str = Directory.GetCurrentDirectory();
                //string[] files=Directory.GetFiles(Directory.GetCurrentDirectory(), "defaultFile.xml.deploy", SearchOption.AllDirectories);
                //var v = TitleContainer.OpenStream(innerFile);
                //xml = XmlReader.Create(v);
                //string srt = File.ReadAllText(innerFile);
                xml = XmlReader.Create(new StringReader(c2));
            }
            try
            {
                if (xml.IsStartElement(XML.Element1))
                {
                    xml.Read();

                    //Read project settings.
                    if (xml.IsStartElement(XML.Element2))
                    {
                        this.ProjectName = xml.GetAttribute(XML.Param1);
                        topBugID = Convert.ToInt32(xml.GetAttribute(XML.Param2));
                        xml.Read();
                    }
                    //Read codes.
                    if (xml.IsStartElement(XML.Element4))
                    {
                        workplace.Project.Programmability.Load(xml);
                    }
                    //Read memmory valeus.
                    if (xml.IsStartElement(XML.Element5))
                    {
                        if (xml.IsEmptyElement == false)
                        {
                            xml.Read();
                            ReadMemmories(xml);
                            xml.ReadEndElement();
                        }
                        else
                            xml.Read();
                    }

                    //Read schemes.
                    while (true)
                    {
                        if (xml.IsStartElement(XML.Element3))
                        {
                            xml.Read();
                            SchemeBak bak = new SchemeBak();
                            bak.Load(xml);
                            xml.ReadEndElement();
                            this.schemeBaks.Add(bak);
                        }
                        else
                            break;
                    }
                }
            }
            catch (Exception e)
            {
                xml.Close();
                return;
            }
            xml.Close();
            //Fill aplication from this bak.
            FillApplication(workplace, topBugID);
        }

        private void ReadMemmories(XmlReader xml)
        {
            while (true)
            {
                if (xml.IsStartElement(XML.Item))
                {
                    xml.Read();
                    string text = xml.Value;
                    this.memmoryValues.Add(new MemmoryValueBak(text));
                    xml.Read();
                    xml.ReadEndElement();
                }
                else
                    break;
            }
        }

        private void FillApplication(WorkPlace workplace, int topBugID)
        {
            //Remmember simulation state and stop it.
            bool isRunningBak = workplace.Simulation.IsRunning;
            workplace.Simulation.Stop();
            foreach (SchemeBak bak in schemeBaks)
            {
                //Create new Scheme, insert it into project, but do not fill it yet, first we need complete bugIdRemap dictionary.
                Scheme scheme = new Scheme(workplace, 0, 0, new Bug(workplace.Project.Bugs.GetBugID()));
                workplace.Project.Bugs.Add(scheme.Bug);
                workplace.Project.SchemeStructure.SchemeCreated(scheme);
                //When new scheme is created, its ID might not be same as ID stored in XML file.
                bugIdRemap.Add(bak.BugBak.ID, scheme.Bug.ID);
            }
            //Fill all created schemes.
            foreach (SchemeBak bak in schemeBaks)
            {
                bak.FillScheme(workplace, workplace.Project.Bugs.GetItem(bugIdRemap[bak.BugBak.ID]).Scheme, bugIdRemap);
            }

            //Set top bug.
            if (topBugID > 0)
                workplace.Project.SetAsTopBug(workplace.Project.Bugs.GetItem(bugIdRemap[topBugID]).Scheme);
            //Heat simulation.
            workplace.Simulation.Heat();

            //Insert memmory values
            foreach (MemmoryValueBak mem in this.memmoryValues)
            {
                mem.InsertValue(workplace.Project.TopPScheme, workplace);
            }

            if(isRunningBak)
                workplace.Simulation.Start();
        }
    }
